import React, { Component } from 'react';
import "../styles/aboutMe.css"
import resume_icon from "../images/resume.png"

class AboutMe extends Component {
    render() {
        return (
            <div className="aboutMe">
                <div className="bio">
<p>The majority of my life, my interests have been categorized into two separate areas - the technical side (degree and career in biochemistry, a return to MTSU for core CS curriculum, experience at Vanderbilt University IT) and the artistic side (musician since age 14, video/photo editing, video art installations). Around 2016, the gap between the two was starting to close - I became extremely interested in coding live visuals and even spent a little time studying electronics (I built an led wall from scratch and rewired an analog synth from the 80's to accept current MIDI protocol). At this point something clicked and I knew that building technical things was what I wanted to do - so I enrolled in the Full-Stack Web Dev program at NSS. It's truly been what I've been looking for all along.</p>
                </div>
                <div className="resume">

                    <img className="resumeIcon" src={resume_icon} alt="image_of_resume"/>

                </div>
            </div>
        );
    }
}

export default AboutMe;
